(1, 0, 0, 0, '', 'RA MẮT PHINDI HỒNG TRÀ MỚI', 'cupteatabledrinkvapor-7080.jpg', 'ra-mat-phindi-hong-tra-mii', 'display,hot', 'news', 1609902364, 0, NULL, 1, 0, 'Lần đầu tiên Cà Phê Phin và Trà kết hợp trong cùng 1 thức uống. PhinDi Hồng Trà Mới đánh dấu sự kết hợp độc đáo tưởng như không hợp nhưng lại vô cùng hoà quyện. Chất Phin quyện Trà của tân binh PhinDi Hồng Trà Mới hứa hẹn sẽ làm bạn mê mẩn ngay lần thử đầu tiên. Siêu phẩm PhinDi Hồng Trà Mới đã có mặt tại gần 400 quán trên toàn quốc, đến quán gần nhất và thử ngay thôi!', '&lt;p&gt;Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.&lt;/p&gt;\r\n'),
(2, 0, 0, 0, '', 'COFFEE PHINDI - CÀ PHÊ PHIN THẾ HỆ MỚI!', 'cupcake-1027.jpg', 'coffee-phindi-ca-phe-phin-the-he-mii', 'display,hot', 'news', 1609902401, 1609902409, NULL, 2, 6, 'Cùng ước muốn mang Cà Phê Phin Việt Nam đến gần hơn với người trẻ. Vẫn mang trong mình tinh tuý chắt lọc từ Cà Phê Phin Việt Nam nhưng êm chất Phin, kết hợp độc đáo cùng những vị ngon từ Kem Sữa - Hạnh Nhân - Choco. PhinDi, Cà Phê Phin Thế Hệ Mới - Chất Phin Êm, Ngon Tròn Vị!PhinDi #Nhẹ_Caffeine là sự hoà quyện sáng tạo của Chất Phin Êm Highlands Coffee có trong bộ 3 Ngon Tròn Vị: PhinDi Kem Sữa, PhinDi Choco và PhinDi Hạnh Nhân.', '&lt;p&gt;Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.&lt;/p&gt;\r\n'),
(3, 0, 0, 0, '', 'COMBO ƯU ĐÃI ĐẬM CHUYỆN CÙNG NGƯỜI THƯƠNG', 'mugbooksmood-1854.jpg', 'combo-uu-dai-dam-chuyen-cung-nguoi-thuong', 'display,hot', 'news', 1609902454, 0, NULL, 3, 1, 'Thật là một cái &quot;cớ&quot; tuyệt vời để bạn có dịp kết nối, chia sẻ với những người mình yêu thương và hãy để thật nhiều câu chuyện đậm đà của bạn được lưu lại tại không gian bạn nhé!', '&lt;p&gt;Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.&lt;/p&gt;\r\n'),
(4, 0, 0, 0, '', 'TOP 50 THƯƠNG HIỆU NHÀ TUYỂN DỤNG HẤP DẪN NHẤT VỚI SINH VIÊN VIỆT NAM 2020', 'coffee-5745.jpg', 'top-50-thuong-hieu-nha-tuyen-dung-hap-dan-nhat-vii-sinh-vien-viet-nam-2020', 'display,hot', 'news', 1609902483, 0, NULL, 4, 3, 'Qua một chặng đường dài, chúng tôi đã không ngừng mang đến những sản phẩm cà phê và trà thơm ngon, đậm đà trong không gian thoải mái và lịch sự với mức giá hợp lý. Những ly trà và cà phê của chúng tôi không chỉ đơn thuần là thức uống quen thuộc mà còn mang trên mình một sứ mệnh văn hóa phản ánh một phần nếp sống hiện đại của người Việt Nam, trở thành thương hiệu cà phê và trà luôn dẫn đầu tại Việt Nam và không ngừng vươn ra thế giới.', '&lt;p&gt;Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.&lt;/p&gt;\r\n'),
(5, 0, 0, 0, '', 'NHẬN THẺ TẬN HƯỞNG CÙNG FREEZE TRÀ XANH!', 'teablackcup-8598.jpg', 'nhan-the-tan-huong-cung-freeze-tra-xanh', 'display,hot', 'news', 1609902550, 0, NULL, 5, 1, 'Hãy đến với chúng tôi và chọn Freeze Trà Xanh! Thưởng thức sự kết hợp hoàn hảo giữa vị Trà Xanh Đậm Đà cùng những miếng Thạch Giòn Khó Cưỡng, chỉ có tại Highlands Coffee! Càng thích mê hơn, các fan còn có cơ hội nhận những ưu đãi hấp dẫn với Thẻ Tận Hưởng như: miễn phí 01 bánh ngọt, 02 lần miễn phí upsize Freeze Trà Xanh và 02 lần miễn phí thêm thạch giòn.', '&lt;p&gt;Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.&lt;/p&gt;\r\n'),
